import React, { useEffect, useState } from "react";
import { fetchAllNews, getGenres } from "../service/NewsService";

function News() {
  // State for genres from the backend
  const [genres, setGenres] = useState([]);
  // Selected genre filter (empty string means no filter)
  const [selectedGenre, setSelectedGenre] = useState("");
  const [newsData, setNewsData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Fetch available genres on component mount
  useEffect(() => {
    async function fetchGenreOptions() {
      try {
        const data = await getGenres();
        setGenres(data);
      } catch (err) {
        console.error("Error fetching genres:", err);
      }
    }
    fetchGenreOptions();
  }, []);

  // Re-fetch news whenever the selected genre changes
  useEffect(() => {
    async function getNews() {
      try {
        setLoading(true);
        // Call fetchAllNews with the selectedGenre filter
        const data = await fetchAllNews(null, selectedGenre);
        setNewsData(data);
      } catch (err) {
        console.error("Error fetching news:", err);
        setError(err);
      } finally {
        setLoading(false);
      }
    }
    getNews();
  }, [selectedGenre]);

  if (loading) return <p>Loading...</p>;
  if (error) return <p>Error: {error.message}</p>;

  return (
    <div>
      <h1>News</h1>
      {/* Genre filter options */}
      <div>
        <strong>Filter by Genre:</strong>
        <ul style={{ listStyle: "none", padding: 0, display: "flex", gap: "0.5rem" }}>
          {genres.map((genre) => (
            <li key={genre.name}>
              <button onClick={() => setSelectedGenre(genre.slug)}>
                {genre.name}
              </button>
            </li>
          ))}
          <li>
            <button onClick={() => setSelectedGenre("")}>All Genres</button>
          </li>
        </ul>
      </div>
      {/* News List */}
      <div>
        {newsData.map((item) => (
          <div key={item.slug} style={{ border: "1px solid #ccc", margin: "1rem", padding: "1rem" }}>
            <h2>{item.name}</h2>
            <p>Released: {item.released}</p>
            <img
              src={item.background_image}
              alt={item.name}
              style={{ width: "300px", height: "auto" }}
            />
            <div>
              <strong>Platforms:</strong>
              <ul>
                {item.platforms.map((p) => (
                  <li key={p.platform.slug}>{p.platform.name}</li>
                ))}
              </ul>
            </div>
            <div>
              <strong>Genres:</strong>
              <ul>
                {item.genres.map((g) => (
                  <li key={g.name}>{g.name}</li>
                ))}
              </ul>
            </div>
            <div>
              <strong>Screenshots:</strong>
              <div style={{ display: "flex", gap: "0.5rem", overflowX: "auto" }}>
                {item.short_screenshots.map((shot, index) => (
                  <img
                    key={index}
                    src={shot.image}
                    alt={`${item.name} screenshot ${index + 1}`}
                    style={{ width: "150px", height: "auto" }}
                  />
                ))}
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default News;
